RecommendedTrackType._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(Namespace, 'basedOnFixedMarks'), pyxb.binding.datatypes.boolean, scope=RecommendedTrackType, documentation='A straight route (known as a recommended track, range or leading line), which comprises: a. at least two structures (usually beacons or daymarks) and/or natural features, which may carry lights and/or top-marks. The structures/features are positioned so that when observed to be in line, a vessel can follow a known bearing with safety. (Adapted from International Association of Lighthouse Authorities - IALA Aids to Navigation Guide, 1990); or b. a single structure or natural feature, which may carry lights and/or a topmark, and a specified bearing which can be followed with safety. (S-57 Edition 3.1, Appendix A Chapter 2, Page 2.72, November 2000, as amended).', location=pyxb.utils.utility.Location('/mnt/data/git/github/S-100-xmlbindings/specifications/s-125/1.0.0/S-125.xsd', 5837, 20)))

